export default function Contact() {
  return (
    <section id="contact" className="p-8 bg-dark">
      <h2 className="text-2xl font-semibold mb-4">Contact</h2>
      <p className="text-gray-400">Email: yourname@example.com</p>
        <p className="text-gray-400">
          GitHub: <a href="https://github.com/yourgithub" className="underline" target="_blank" rel="noopener noreferrer">yourgithub</a>
        </p>
      </section>
    );
  }
